INSERT INTO `blogs` VALUES (2,1,'Development','First Thoughts so','','#### Here we go building out StudyWorx 3!\r\n\r\nI love it I think. Pretty sweet.\r\nDoes this kick a new line?\r\n\r\n- Here\'s a point.\r\n- And another\r\n    - Now we are cooking.\r\n    - Love it.\r\nWell how about now?\r\n\r\n---','2012-10-27 17:50:35','2013-05-18 15:01:49',0,0,0,0),(3,1,'Getting Started','Creating a New School','','## Creating a School\r\n\r\nBefore you begin you will need to be at least a level 1 Administrator. If you do not know what that means you will need to contact the site administrator here. \r\n\r\nOnce you have been promoted to a site administrator you should then have a new entry in your profile menu.\r\n\r\nClick on the link called \"School Administration\".\r\n\r\nEnjoy!\r\n\r\n{:> Tom Possin','2012-11-06 23:08:20','2013-05-06 23:59:19',1,0,1,0),(4,1,'Getting Started','Welcome to Studyworx 3!','','### [StudyWorx 3 - The next Level...](http://studyworx.net)\r\n\r\nStudyworx 3 is the next iteration of Studyworx. \r\n\r\nIt is a full featured online educational platform.^1b \r\nI guess that works ok.\r\n\r\n\r\n>Everything you ever wanted... if all you ever wanted was to chart.\r\n\r\n[Quickworx][1]\r\n[Studyworx][2]\r\n\r\n\r\n{:> Tom\r\n\r\n[1]: http://quickworx.info\r\n[2]: http://studyworx.net','2012-11-10 15:00:19','2013-05-02 21:08:55',1,1,NULL,0);
