INSERT INTO `documents` VALUES (13,1,2,6,4,'Summary of Everything\r\n---------------------\r\n\r\nWell it all started a long long time ago. In a galaxy far far away.\r\n\r\nNot really but it is a good start for a story I think - don\'t you.\r\n\r\nOk how about a bit of autosaving?\r\n\r\n> > > -   I like **red bullets** because they are **faster**.\r\n> > > -   Also chicks *love* them.\r\n> > > -   This is a huge screen for playing around on.\r\n> > >\r\n> > >     -   I could go on and on.\r\n> > >     -   This is really working pretty good.\r\n> > >     -   I am not sure what people would not like about this.\r\n> > >     -   Here is another bullet but I am not seeing the save thing.\r\n\r\n> > > Ok, this is a new line. And the autosave thing works as well.\r\n\r\nThis should be working pretty well now.\r\n\r\n    Column1   Column2   Column3\r\n    -------   -------   -------\r\n       3         10        12\r\n',0,'This should work now','2013-03-07 04:12:58','2013-04-09 00:24:07'),(27,1,2,5,6,'Epistle BRI\r\n===========\r\n\r\n#### Critical Method\r\n\r\n### Authorship\r\n\r\n***Internal Evidence***\r\n\r\nWrite stuff here and it will show up over on the right.\r\n\r\nHere is another paragraph.\r\n\r\n- Here is a bullet\r\n- Here is another one.\r\n\r\n    - Another level\r\n    - Another one.\r\n\r\n> This is indented\r\n\r\n***External Evidence***\r\n\r\n***Conclusion***\r\n\r\n### Dating\r\n\r\n***Internal Evidence***\r\n\r\n***External Evidence***\r\n\r\n***Conclusion***\r\n\r\n### Recipient\r\n\r\n***Internal Evidence***\r\n\r\n***External Evidence***\r\n\r\n***Conclusion***\r\n\r\n#### Historical Method\r\n\r\n#### Survey Method\r\n\r\n### Signature\r\n\r\nPlease sign if you have done all the required readings:\r\n\r\n*Your name here*\r\n\r\n* * * * *\r\n',0,NULL,'2013-03-14 01:16:53','2013-04-09 00:50:18'),(28,1,2,6,1,'Epistle BRI\r\n===========\r\n\r\n#### Critical Method\r\n\r\n>_If you just want to type this is the way to do it. It will save as you go and you never have to think about it the rest of the year._\r\n\r\nHere the thing, yep yep it works with ctrl+s\r\n\r\n\r\n### Authorship\r\n\r\nInternal Evidence\r\n\r\n>\r\nOk one more time to see if things are really working the way they should. I guess at this point they seem to be working pretty good. I don\'t know about the virtual keyboard thing and the autosave. But time will tell. This should give people a pretty good understanding of what they are doing as they type.\r\n\r\nExternal Evidence\r\n\r\n>>\r\nIf you like green there is always this little feature. There is no doubt that some would like it. After a while it would become obvious that they really do not think about formatting all that much. If they want to highlight something or whatever it is pretty easy.\r\n\r\nConclusion\r\n\r\n### Dating\r\n\r\nInternal Evidence\r\n\r\nExternal Evidence\r\n\r\nConclusion\r\n\r\n### Recipient\r\n\r\nInternal Evidence\r\n\r\nExternal Evidence\r\n\r\nConclusion\r\n\r\n#### Historical Method\r\n\r\n#### Survey Method\r\n\r\n#### Signature\r\n\r\nPlease sign if you have done all the required readings:\r\n\r\nYour name here\r\n\r\nThis is below the bottom a bit but it seems to work now. Not sure what the dealio is.\r\n\r\nI don\'t know if this is a limit on how far you can scroll or what.\r\nThis is a pretty big thing no sure what the difference is.\r\n\r\n* Bullet\r\n* Bullet\r\n* Bullet\r\n* Bullet\r\n    * Bullet\r\n    * Bullet\r\n\r\nNow we got some weirdness going on.\r\nNot sure how else to explain this.\r\nHas to do with the measurements.\r\n\r\nWell let\'s see if this matters at all.\r\n\r\nNot really\r\n\r\nNot sure what this is all about but it is fried\r\n\r\nOk one more time bucko You suck.\r\n\r\nLet\'s try this again.\r\n\r\n\r\n\r\n',0,'Ok','2013-03-14 03:09:29','2013-05-18 15:53:53'),(29,1,2,6,3,'\r\n## What is Markdown?\r\n\r\n\r\n_Markdown is an easy way to format your documents without having to constantly highlight text and click buttons._\r\n_To use markdown you just add a few markers to your text and it will appear as nicely formatted text as soon as you save it._ **It even looks good as is**\r\n\r\n#### Adding Headings\r\n\r\nTo add a heading just put a pound sign(s) in front of your text. You can add up to 6 pound signs which will represent Headings 1 - 6.\r\n\r\n```\r\n# Heading 1\r\n## Heading 2\r\n### Heading 3\r\n#### Heading 4\r\n##### Heading 5\r\n###### Heading 6\r\n```\r\n\r\nAnd these headings will look like the following when you view them.\r\n# Heading 1\r\n\r\n## Heading 2\r\n\r\n### Heading 3\r\n\r\n#### Heading 4\r\n\r\n##### Heading 5\r\n\r\n###### Heading 6\r\n\r\n\r\n#### Adding other formatting\r\n\r\n\r\nBeside headings there are many other formats available. Here is an important rule.\r\n\r\n>**To change formats _always_ add a blank line above the text you wish to format.**\r\n\r\nIf you ever have a line that does not seem to format itself as expected, add blank lines above and below.\r\n\r\n#### Italic, Bold, and Bold Italic\r\nYou can use either * or _ to create the above formats it\'s really easy.\r\n\r\n~~~\r\n*Italic*\r\n**Bold**\r\n***Bold Italic***\r\n_Italic_\r\n__Bold__\r\n___Bold Italic___\r\n\r\n~~~\r\n\r\nEither of the above produce the following it\'s just a matter of preference:\r\n*Italic*\r\n**Bold**\r\n***Bold Italic***\r\n\r\n\r\n#### Indents and colors\r\n\r\nTo add indented text you simply need to add a > to the beginning of the first line. \r\nIt\'s as easy as this.\r\n\r\n```\r\n> Indented text begins like this...\r\nMore indented text.\r\n   < This blank line ends indentation >\r\nA fresh un-indented line\r\n\r\n```\r\nThis is what results from the above:\r\n\r\n> Indented text begins like this...\r\nMore indented text.\r\n\r\nA fresh un-indented line\r\n\r\n\r\n>>>**Adding Colored Indented test**\r\n\r\nTo use colored text do the following:\r\n\r\n```\r\n> This is indented black text.\r\n>> This is indented Green text.\r\n>>> This is indented Red text.\r\n\r\n```\r\n\r\n> This is indented black text.\r\n>> This is indented Green text.\r\n>>> This is indented Red text.\r\n\r\nThis is the same as the above:\r\n\r\n```\r\n>\r\nBlack indented text.\r\n>>\r\nGreen indented text\r\n>>>\r\nRed indented text.\r\n```\r\n\r\n#### Adding a Horizontal line\r\nTo draw a horizontal line across the page simply add 3 minus signs.\r\n\r\n    ---\r\n\r\nThis will make a nice looking line across the page.\r\n\r\n---\r\n\r\n#### Making Literal text.\r\n\r\nTo make text formatted exactly as you type it use a \"code block\". \r\n\r\n~~~\r\n\r\n~~~use three tilde\'s above\r\n\r\n    *\r\n     ^\r\n    ===\r\n  ========\r\n | <>  <> |\r\n \\    |   /\r\n    ~~~~\r\n    \\  /\r\n     \"\" \r\n~~~use three tilde\'s below \r\nto \"fence in\" your literal text.\r\n\r\n~~~\r\nAny text between these two lines of tilde\'s will be formatted just as it is typed and it will be contained in a box, just like the text above.\r\n\r\n#### Adding Bullets\r\n\r\nTo make bulleted text you just add a * with a space following and you will get a bullet.\r\n(make sure you have a blank line over the first bulleted line)\r\n\r\n    * Bulleted Text \r\nThis produces the following:\r\n\r\n* Bulleted Text \r\n\r\n**Nested Lists**\r\nBullets and Numbered lists can have many layers.\r\n\r\n    * First level Bullet text\r\n        * (Add 4 spaces in front)\r\n            * (Add 8 spaces and so on)\r\n\r\nThis will produce the following:\r\n\r\n* First level Bullet text\r\n    * (Add 4 space in front)\r\n        * (Add 8 spaces and so on)\r\n\r\n_You see that even without formatting it is perfectly readable as a nested list._\r\nNumbered lists work just like bulleted lists only you start each line with a number a period and a space.\r\n(Leave a blank line over your numbered lists too)\r\n\r\n    1. First level numbered list.\r\n        1. Second level\r\n        2. (use four spaces)\r\n            1. Third level\r\n            2. (use 8 spaces)\r\n    2. Another first level\r\n\r\nThis produces the following:\r\n\r\n1. First level numbered list.\r\n    1. Second level\r\n    2. (use four spaces)\r\n        1. Third level\r\n        2. (use 8 spaces)\r\n2. Another first level\r\n\r\n#### Creating Links to web pages\r\n\r\nThere are several ways to create links to web pages, I will give you three which should be enough to handle almost any circumstance.\r\n\r\n**auto-links**\r\n\r\nLinks will automatically be created whenever you enclose a web address in <>\r\nExample:\r\n\r\n~~~\r\n\r\n<http://studyworx.net>\r\n\r\n~~~\r\n\r\nThe above will produce:\r\n\r\n<http://studyworx.net>\r\n\r\nFor references and footnotes this is often the quickest and clearest way to create links that give the address, as well as a direct link to the site.\r\n\r\n**Named Links**\r\n\r\nWhat if you want a nice name for a long ugly link? There is another way.\r\n\r\n~~~\r\n\r\n[Sweet happy named link](http://studyworx.net)\r\n\r\n~~~\r\n\r\nThe above will produce:\r\n\r\n[Sweet happy named link](http://studyworx.net)\r\n\r\nBut what if you want to put a long ugly link in the middle of a sentence and you don\'t want it to look terrible?\r\n\r\n***Referenced Links***\r\n\r\nA referenced link allow you to use a link in a sentence without making your sentence a total mess.\r\n\r\n~~~\r\n\r\n    Check [here][1] for the answer.\r\n\r\n    Then anywhere later, usually at the end \r\n    of your document add the link like this:\r\n\r\n    [1]: http://studyworx.net \"pop up text\"\r\n\r\n~~~\r\n\r\nThe above will produce this:\r\n\r\nCheck [here][1] for the answer.\r\n\r\n[1]: http://studyworx.net \"Pop up text\"\r\n\r\n\r\nThis is bazzaar - do not get this at all.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n',0,'Final app stickie note.','2013-03-14 03:10:47','2013-04-08 20:14:51'),(30,3,2,6,1,'# Epistle BRI\r\n\r\n#### Critical Method\r\n\r\n## Authorship\r\n\r\n___Internal Evidence___\r\n\r\nWe got us a little internal evidence here.\r\nLooks pretty good overall.\r\n\r\nAnd who knows I may get done with this yet.\r\n\r\n___External Evidence___\r\n\r\nThis actually looks pretty good and I don\'t see why anyone would not like this.\r\n\r\nIt is totally easy, I need to really try to herd people in this direction I think.\r\n\r\n___Conclusion___\r\n\r\n\r\n##Dating\r\n\r\n___Internal Evidence___\r\n\r\nThis is the date I think and I think this is about the right amount of autosaving.\r\n\r\n\r\nHey Ho and away we go! I am not sure how to get more spaces in there I may need to look at the p tags in here.\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n## Recipient\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n#### Historical Method\r\n\r\n\r\n\r\n#### Survey Method\r\n\r\n\r\n\r\n## Signature\r\n\r\nPlease sign if you have done all the required readings:\r\n\r\n_Your name here_\r\n\r\n---\r\n\r\n\r\n\r\n\r\n',0,NULL,'2013-03-21 03:10:09','2013-03-29 22:13:02'),(31,3,2,6,3,'Sweet final truth here.',0,NULL,'2013-03-21 03:13:26','2013-03-21 03:13:26'),(32,1,2,4,7,'# Epistle BRI\r\n\r\n#### Critical Method\r\n\r\n## Authorship\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n## Dating\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n## Recipient\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n#### Historical Method\r\n\r\n\r\n\r\n#### Survey Method\r\n\r\n\r\n\r\n## Signature\r\n\r\nPlease sign if you have done all the required readings:\r\n\r\n_Your name here_\r\n\r\n---\r\n\r\n\r\n\r\n\r\n',0,NULL,'2013-03-24 13:55:29','2013-03-25 16:44:39'),(33,4,2,6,1,'# Epistle BRI\r\n\r\n#### Critical Method\r\n\r\n## Authorship\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n## Dating\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n## Recipient\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n#### Historical Method\r\n\r\n\r\n\r\n#### Survey Method\r\n\r\n\r\n\r\n## Signature\r\n\r\nPlease sign if you have done all the required readings:\r\n\r\n_Your name here_\r\n\r\n---\r\n\r\n\r\n\r\n\r\n',0,NULL,'2013-03-29 22:34:49','2013-03-29 22:34:49'),(34,4,2,6,3,'Sweet final truth here.',0,NULL,'2013-03-29 22:39:19','2013-03-29 22:39:19'),(35,1,2,4,9,'Sweet final truth here.',0,NULL,'2013-04-10 15:02:28','2013-04-10 15:02:29'),(36,1,2,4,10,'<h2>Notes on HTML editors<br></h2>This is now writing html.<br>I am not sure if I should keep this.<br><br><blockquote>This is highly weird.<br></blockquote><br>Wow.<br>Kinda hate this.<br><ul><li>Most annoying.</li><li>But it works I guess.</li></ul>This is strange.<br><ol><li>Step one<br><ul><li>Here is a bullet.</li><li>And another</li></ul></li><li>This actually grows on you after a while.<br><ol><li>It does things that work but not obviously.</li><li>Nope<br><ul><li>And your little sub-point too.</li></ul></li><li>Yep</li></ol></li><li>See it works.<br></li></ol><br><br><br>',1,NULL,'2013-04-10 15:02:35','2013-04-10 15:08:53'),(37,1,2,3,5,'# Epistle BRI\r\n\r\n#### Critical Method\r\n\r\n## Authorship\r\n\r\n___Internal Evidence___\r\n\r\nThis is some stuff that could work.\r\nI guess this did not get broken by my last change.\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n## Dating\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n## Recipient\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n#### Historical Method\r\n\r\n\r\n\r\n#### Survey Method\r\n\r\n\r\n\r\n## Signature\r\n\r\nPlease sign if you have done all the required readings:\r\n\r\n_Your name here_\r\n\r\n---\r\n\r\n\r\n\r\n\r\n',0,NULL,'2013-04-10 16:11:30','2013-04-30 02:15:44'),(38,3,2,3,13,'## This is good.\r\n\r\nI think we got this going now.\r\n\r\nShould be no problem from here on out.\r\n\r\n___This will look ok I guess___\r\n\r\n\r\n',0,NULL,'2013-04-10 16:23:38','2013-05-09 13:06:06'),(39,3,2,3,5,'# Epistle BRI\r\n\r\n#### Critical Method\r\n\r\n## Authorship\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n## Dating\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n## Recipient\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n#### Historical Method\r\n\r\n\r\n\r\n#### Survey Method\r\n\r\n\r\n\r\n## Signature\r\n\r\nPlease sign if you have done all the required readings:\r\n\r\n_Your name here_\r\n\r\n---\r\n\r\n\r\n\r\n\r\n',0,NULL,'2013-04-10 16:24:01','2013-04-10 16:24:01'),(40,3,2,3,15,'***Sweet final truth here.***\r\n\r\nI think we got the sweetness now.\r\n\r\n* Yep very sweet.\r\n* Again and again\r\n	* And this works too.\r\n\r\n~~~\r\n	Just to show there is no hard feelings\r\n	   I like this stuff\r\n	      It is really quite easy to use.\r\n~~~\r\n\r\n{:> One\r\n\r\n',0,NULL,'2013-04-10 16:24:15','2013-04-26 00:09:46'),(41,2,2,3,13,'### Add Text Here.\r\n\r\n* This is first.\r\n	* Now she works\r\n	* Really sweet. ;)\r\n		1. I think you know what I am talking about.\r\n		2. This is another one.\r\n	* This is nice.\r\n\r\n1. Now what?\r\n	* Nice.\r\n		1. Ok now we are working it.\r\n		2. Looks fine.\r\n	* Nice again. and again.\r\n2. Now you get it.\r\n',0,NULL,'2013-04-14 21:33:46','2013-04-14 21:45:12'),(42,3,2,9,11,'# Old Testament stuff.\r\n\r\nThis would be a BRI someday if it lives that long.\r\n\r\n* This is a point.\r\n* And another.\r\n	* I think this is working ok now.\r\n	* Ok\r\n* Hey there.\r\n\r\n>Now we can do a few other things down here and it should look ok.\r\n\r\n',0,NULL,'2013-04-20 19:18:16','2013-04-20 19:40:12'),(43,1,2,3,13,'## Key verse for Titus\r\n\r\nYessirie this is a sweet key verse.\r\n\r\nI think I like not worrying about touching the stupid touch pad it was making me type weird.\r\n\r\n	 I guess this is good\r\n	 So I will keep on going\r\n\r\n* And I got some bullets and whatnot.\r\n	* Lots of bullets\r\n	* and more....\r\n\r\nSo now I think I am done.\r\n\r\n',0,NULL,'2013-05-03 00:38:48','2013-05-06 22:30:34'),(44,1,2,3,15,'Sweet final truth here.',0,NULL,'2013-05-04 00:28:13','2013-05-04 00:28:13'),(45,4,2,3,13,'## Key Verse - Titus\r\n\r\nThis is the key verse for Titus.\r\n\r\n### Main Idea\r\n\r\nThis is the main idea\r\n\r\n### Reason Written\r\n\r\nThis is the reason it was written.\r\n\r\n',0,NULL,'2013-05-06 18:29:55','2013-05-06 18:41:10'),(46,3,2,5,6,'# Epistle BRI\r\n\r\n_This is Busters work_\r\n\r\n#### Critical Method\r\n\r\n## Authorship\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n## Dating\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n## Recipient\r\n\r\n___Internal Evidence___\r\n\r\n___External Evidence___\r\n\r\n___Conclusion___\r\n\r\n\r\n#### Historical Method\r\n\r\n\r\n\r\n#### Survey Method\r\n\r\n\r\n\r\n## Signature\r\n\r\nPlease sign if you have done all the required readings:\r\n\r\n_Your name here_\r\n\r\n---\r\n\r\n\r\n\r\n\r\n',0,NULL,'2013-05-12 20:45:44','2013-05-12 20:46:05');
