INSERT INTO `grades` VALUES (1,2,3,3,2,1,1,87,0,'This assignment was pretty good.\r\n\r\nNot great but ok.\r\n\r\nBuster','This needs work.\r\n\r\nHere is the stuff I am writing to you.\r\n\r\n','Key Verse - 5 %\r\nBRI - 10 %\r\nCharting - 50 %\r\nFinal App - 10 %\r\nOk let\'s see if this thing.\r\n','2013-03-23 19:31:08','2013-05-13 21:46:03'),(2,2,6,1,1,1,0,100,1,'Staff comments blah blah.\r\nYep.','Student comments and whatnot.\r\nHere is some more.','Key Verse - 5 %\r\nLet\'s see if this really saves.\r\nOk this works I guess.\r\nBRI - 10 %\r\n\r\nLet\'s say I am grading the BRI here. It seems to work pretty good. No real problem here. I just need to type a bit more to check out the scrolling and what not.\r\n\r\nBlah Blah Blah.\r\nMore stuff.\r\n\r\nCharting - 50 %\r\nFinal App - 10 %\r\nOk let\'s see if this thing.\r\n','2013-03-24 00:35:04','2013-03-29 19:32:27'),(3,2,4,1,1,1,0,87,1,'','','Key Verse - 5 %\r\nBRI - 10 %\r\nCharting - 50 %\r\nFinal App - 10 %\r\nOk let\'s see if this thing.\r\n','2013-03-24 13:55:15','2013-05-06 21:11:20'),(4,2,3,1,1,1,1,NULL,0,NULL,NULL,'Key Verse - 5 %\r\nBRI - 10 %\r\nCharting - 50 %\r\nFinal App - 10 %\r\nOk let\'s see if this thing.\r\n','2013-03-24 21:00:01','2013-05-04 21:14:08'),(5,2,5,1,1,1,1,NULL,0,'This is a sweet staff comment.','This is a sweet student comment.','### Grading notes...\r\n\r\nOk this is going to work I guess.','2013-03-24 21:07:38','2013-03-28 01:39:07'),(6,2,6,3,2,1,0,NULL,0,NULL,NULL,'Key Verse - 5 %\r\nBRI - 10 %\r\nCharting - 50 %\r\nFinal App - 10 %\r\nOk let\'s see if this thing.\r\n','2013-03-29 20:23:34','2013-05-06 21:19:03'),(7,2,3,5,2,0,0,NULL,0,NULL,NULL,'Key Verse - 5 %\r\nBRI - 10 %\r\nCharting - 50 %\r\nFinal App - 10 %\r\nOk let\'s see if this thing.\r\n','2013-03-29 21:41:35','2013-03-29 21:41:35'),(8,2,4,5,2,0,0,NULL,0,NULL,NULL,'Key Verse - 5 %\r\nBRI - 10 %\r\nCharting - 50 %\r\nFinal App - 10 %\r\nOk let\'s see if this thing.\r\n','2013-03-29 21:41:35','2013-03-29 21:41:35'),(9,2,5,5,2,1,0,NULL,0,NULL,NULL,'### Grading notes...','2013-03-29 21:41:35','2013-03-29 21:41:35'),(10,2,6,5,2,1,0,NULL,0,NULL,NULL,'Key Verse - 5 %\r\nBRI - 10 %\r\nCharting - 50 %\r\nFinal App - 10 %\r\nOk let\'s see if this thing.\r\n','2013-03-29 21:41:36','2013-03-29 21:41:36'),(11,2,4,3,2,0,0,NULL,0,NULL,NULL,'Key Verse - 5 %\r\nBRI - 10 %\r\nCharting - 50 %\r\nFinal App - 10 %\r\nOk let\'s see if this thing.\r\n','2013-04-14 19:06:06','2013-04-14 19:06:06'),(12,2,5,3,2,1,1,77,0,'This is not the sweetest work I have ever seen.\r\n\r\nBut it is work, I guess.\r\n\r\nBuster','Hey this is great work sort of....\r\n\r\nCould be better\r\n\r\nCould have done more.','### Grading notes...\r\n\r\nOh these are some sweet notes, yep!\r\n','2013-04-14 19:06:06','2013-05-13 20:57:57'),(13,2,9,3,2,1,0,NULL,0,NULL,NULL,'Key Verse - 5 %\r\nBRI - 10 %\r\nCharting - 50 %\r\nFinal App - 10 %\r\nOk let\'s see if this thing.\r\n','2013-04-20 19:40:37','2013-04-20 19:40:53');
