INSERT INTO `helps` VALUES (1,'Markdown Cheatsheet','-\r\n\r\n## What is Markdown?\r\n\r\n\r\n_Markdown is an easy way to format your documents without having to constantly highlight text and click buttons._\r\n_To use markdown you just add a few markers to your text and it will appear as nicely formatted text as soon as you save it._ **It even looks good as is**\r\n\r\n#### Adding Headings\r\n\r\nTo add a heading just put a pound sign(s) in front of your text. You can add up to 6 pound signs which will represent Headings 1 - 6.\r\n\r\n```\r\n# Heading 1\r\n## Heading 2\r\n### Heading 3\r\n#### Heading 4\r\n##### Heading 5\r\n###### Heading 6\r\n```\r\n\r\nAnd these headings will look like the following when you view them.\r\n# Heading 1\r\n## Heading 2\r\n### Heading 3\r\n#### Heading 4\r\n##### Heading 5\r\n###### Heading 6\r\n\r\n#### Adding other formatting\r\n\r\nBeside headings there are many other formats available. Here is an important rule.\r\n\r\n>**To change formats _always_ add a blank line above the text you wish to format.**\r\n\r\nIf you ever have a line that does not seem to format itself as expected, add blank lines above and below.\r\n\r\n#### Italic, Bold, and Bold Italic\r\nYou can use either * or _ to create the above formats it\'s really easy.\r\n\r\n~~~\r\n*Italic*\r\n**Bold**\r\n***Bold Italic***\r\n_Italic_\r\n__Bold__\r\n___Bold Italic___\r\n\r\n~~~\r\n\r\nEither of the above produce the following it\'s just a matter of preference:\r\n*Italic*\r\n**Bold**\r\n***Bold Italic***\r\n\r\n\r\n#### Indents and colors\r\n\r\nTo add indented text you simply need to add a > to the beginning of the first line. \r\nIt\'s as easy as this.\r\n\r\n```\r\n> Indented text begins like this...\r\nMore indented text.\r\n   < This blank line ends indentation >\r\nA fresh un-indented line\r\n\r\n```\r\nThis is what results from the above:\r\n\r\n> Indented text begins like this...\r\nMore indented text.\r\n\r\nA fresh un-indented line\r\n\r\n\r\n>>>**Adding Colored Indented test**\r\n\r\nTo use colored text do the following:\r\n\r\n```\r\n> This is indented black text.\r\n>> This is indented Green text.\r\n>>> This is indented Red text.\r\n\r\n```\r\n\r\n> This is indented black text.\r\n>> This is indented Green text.\r\n>>> This is indented Red text.\r\n\r\nThis is the same as the above:\r\n\r\n```\r\n>\r\nBlack indented text.\r\n>>\r\nGreen indented text\r\n>>>\r\nRed indented text.\r\n```\r\n\r\n#### Adding a Horizontal line\r\nTo draw a horizontal line across the page simply add 3 minus signs.\r\n\r\n    ---\r\n\r\nThis will make a nice looking line across the page.\r\n\r\n---\r\n\r\n#### Making Literal text.\r\n\r\nTo make text formatted exactly as you type it use a \"code block\". \r\n\r\n~~~\r\n\r\n~~~use three tilde\'s above\r\n\r\n    *\r\n     ^\r\n    ===\r\n  ========\r\n | <>  <> |\r\n \\    |   /\r\n    ~~~~\r\n    \\  /\r\n     \"\" \r\n~~~use three tilde\'s below \r\nto \"fence in\" your literal text.\r\n\r\n~~~\r\nAny text between these two lines of tilde\'s will be formatted just as it is typed and it will be contained in a box, just like the text above.\r\n\r\n#### Adding Bullets\r\n\r\nTo make bulleted text you just add a * with a space following and you will get a bullet.\r\n(make sure you have a blank line over the first bulleted line)\r\n\r\n    * Bulleted Text \r\nThis produces the following:\r\n\r\n* Bulleted Text \r\n\r\n**Nested Lists**\r\nBullets and Numbered lists can have many layers.\r\n\r\n    * First level Bullet text\r\n        * (Add 4 spaces in front)\r\n            * (Add 8 spaces and so on)\r\n\r\nThis will produce the following:\r\n\r\n* First level Bullet text\r\n    * (Add 4 space in front)\r\n        * (Add 8 spaces and so on)\r\n\r\n_You see that even without formatting it is perfectly readable as a nested list._\r\nNumbered lists work just like bulleted lists only you start each line with a number a period and a space.\r\n(Leave a blank line over your numbered lists too)\r\n\r\n    1. First level numbered list.\r\n        1. Second level\r\n        2. (use four spaces)\r\n            1. Third level\r\n            2. (use 8 spaces)\r\n    2. Another first level\r\n\r\nThis produces the following:\r\n\r\n1. First level numbered list.\r\n    1. Second level\r\n    2. (use four spaces)\r\n        1. Third level\r\n        2. (use 8 spaces)\r\n2. Another first level\r\n\r\n#### Creating Links to web pages\r\n\r\nThere are several ways to create links to web pages, I will give you three which should be enough to handle almost any circumstance.\r\n\r\n**auto-links**\r\n\r\nLinks will automatically be created whenever you enclose a web address in <>\r\nExample:\r\n\r\n~~~\r\n\r\n<http://studyworx.net>\r\n\r\n~~~\r\n\r\nThe above will produce:\r\n\r\n<http://studyworx.net>\r\n\r\nFor references and footnotes this is often the quickest and clearest way to create links that give the address, as well as a direct link to the site.\r\n\r\n**Named Links**\r\n\r\nWhat if you want a nice name for a long ugly link? There is another way.\r\n\r\n~~~\r\n\r\n[Sweet happy named link](http://studyworx.net)\r\n\r\n~~~\r\n\r\nThe above will produce:\r\n\r\n[Sweet happy named link](http://studyworx.net)\r\n\r\nBut what if you want to put a long ugly link in the middle of a sentence and you don\'t want it to look terrible?\r\n\r\n***Referenced Links***\r\n\r\nA referenced link allow you to use a link in a sentence without making your sentence a total mess.\r\n\r\n~~~\r\n\r\n    Check [here][1] for the answer.\r\n\r\n    Then anywhere later, usually at the end \r\n    of your document add the link like this:\r\n\r\n    [1]: http://studyworx.net \"pop up text\"\r\n\r\n~~~\r\n\r\nThe above will produce this:\r\n\r\nCheck [here][1] for the answer.\r\n\r\n[1]: http://studyworx.net \"Pop up text\"\r\n\r\n\r\n#### Adding Images\r\n\r\nLinking to images is almost identical to creating normal links. You can not upload images to this server, however by using publicly shared images you can link to them. \r\n\r\n1. Get the address of the image you want to link to by right clicking on the image and clicking \"copy image location\"\r\n2. Paste that location in your document.\r\n3. Add a ! and some brackets like below.\r\n\r\n~~~\r\n\r\n![Any Happy name](https://sitename.com/image.jpg)\r\n\r\nYou can also do this \"reference style\" just like regular links.\r\n\r\n![Any Happy name][1]\r\n\r\n    [1]: https://sitename.com/image.jpg\r\n\r\np.s. Be careful to choose small pictures.\r\n\r\n~~~\r\n\r\nProduces:\r\n\r\n![Any Happy name](https://files.one.ubuntu.com/5HMlJhi2TA6HEZUJC-KIqA)\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n',0,'2013-03-09 03:38:02','2013-03-13 03:21:53'),(2,'Wicked_pdf Readme','# Wicked PDF [![Build Status](https://secure.travis-ci.org/mileszs/wicked_pdf.png)](http://travis-ci.org/mileszs/wicked_pdf)\r\n\r\n## A PDF generation plugin for Ruby on Rails\r\n\r\nWicked PDF uses the shell utility [wkhtmltopdf](http://code.google.com/p/wkhtmltopdf/) to serve a PDF file to a user from HTML.  In other words, rather than dealing with a PDF generation DSL of some sort, you simply write an HTML view as you would normally, then let Wicked take care of the hard stuff.\r\n\r\n_Wicked PDF has been verified to work on Ruby 1.8.7 and 1.9.2; Rails 2 and Rails 3_\r\n\r\n### Installation\r\n\r\nFirst, be sure to install [wkhtmltopdf](http://code.google.com/p/wkhtmltopdf/).\r\nIf your wkhtmltopdf executable is not on your webserver\'s path, configure it in an initializer:\r\n    WickedPdf.config = {\r\n      :exe_path => \'/usr/local/bin/wkhtmltopdf\'\r\n    }\r\nNote that versions before 0.9.0 [have problems](http://code.google.com/p/wkhtmltopdf/issues/detail?id=82&q=vodnik) on some machines with reading/writing to streams.\r\nThis plugin relies on streams to communicate with wkhtmltopdf.\r\n\r\nMore information about [wkhtmltopdf](http://code.google.com/p/wkhtmltopdf/) could be found [here](http://madalgo.au.dk/~jakobt/wkhtmltoxdoc/wkhtmltopdf-0.9.9-doc.html).\r\n\r\nNext:\r\n\r\n    script/plugin install git://github.com/mileszs/wicked_pdf.git\r\n    script/generate wicked_pdf\r\n\r\nor add this to your Gemfile:\r\n\r\n    gem \'wicked_pdf\'\r\n    \r\nYou may also need to add \r\n    Mime::Type.register \"application/pdf\", :pdf\r\nto config/initializers/mime_types.rb\r\n\r\n### Basic Usage\r\n\r\n    class ThingsController < ApplicationController\r\n      def show\r\n        respond_to do |format|\r\n          format.html\r\n          format.pdf do\r\n            render :pdf => \"file_name\"\r\n          end\r\n        end\r\n      end\r\n    end\r\n\r\n### Advanced Usage with all available options\r\n\r\n    class ThingsController < ApplicationController\r\n      def show\r\n        respond_to do |format|\r\n          format.html\r\n          format.pdf do\r\n            render :pdf                            => \'file_name\',\r\n                   :disposition	                   => \'attachment\',                 # default \'inline\'                   \r\n                   :template                       => \'things/show.pdf.erb\',\r\n                   :file                           => \"#{Rails.root}/files/foo.erb\"\r\n                   :layout                         => \'pdf.html\',                   # use \'pdf.html\' for a pdf.html.erb file\r\n                   :wkhtmltopdf                    => \'/usr/local/bin/wkhtmltopdf\', # path to binary\r\n                   :show_as_html                   => params[:debug].present?,      # allow debuging based on url param\r\n                   :orientation                    => \'Landscape\',                  # default Portrait\r\n                   :page_size                      => \'A4, Letter, ...\',            # default A4\r\n                   :save_to_file                   => Rails.root.join(\'pdfs\', \"#{filename}.pdf\"),\r\n                   :save_only                      => false,                        # depends on :save_to_file being set first\r\n                   :proxy                          => \'TEXT\',\r\n                   :basic_auth                     => false                         # when true username & password are automatically sent from session\r\n                   :username                       => \'TEXT\',\r\n                   :password                       => \'TEXT\',\r\n                   :cover                          => \'URL\',\r\n                   :dpi                            => \'dpi\',\r\n                   :encoding                       => \'TEXT\',\r\n                   :user_style_sheet               => \'URL\',\r\n                   :cookie                         => [\'_session_id SESSION_ID\'], # could be an array or a single string in a \'name value\' format\r\n                   :post                           => [\'query QUERY_PARAM\'],      # could be an array or a single string in a \'name value\' format\r\n                   :redirect_delay                 => NUMBER,\r\n                   :zoom                           => FLOAT,\r\n                   :page_offset                    => NUMBER,\r\n                   :book                           => true,\r\n                   :default_header                 => true,\r\n                   :disable_javascript             => false,\r\n                   :grayscale                      => true,\r\n                   :lowquality                     => true,\r\n                   :enable_plugins                 => true,\r\n                   :disable_internal_links         => true,\r\n                   :disable_external_links         => true,\r\n                   :print_media_type               => true,\r\n                   :disable_smart_shrinking        => true,\r\n                   :use_xserver                    => true,\r\n                   :no_background                  => true,\r\n                   :extra                          => \'\'                        # directly inserted into the command to wkhtmltopdf\r\n                   :margin => {:top                => SIZE,                     # default 10 (mm)\r\n                               :bottom             => SIZE,\r\n                               :left               => SIZE,\r\n                               :right              => SIZE},\r\n                   :header => {:html => { :template => \'users/header.pdf.erb\',  # use :template OR :url\r\n                                          :layout   => \'pdf_plain.html\',        # optional, use \'pdf_plain.html\' for a pdf_plain.html.erb file, defaults to main layout\r\n                                          :url      => \'www.example.com\',\r\n                                          :locals   => { :foo => @bar }},\r\n                               :center             => \'TEXT\',\r\n                               :font_name          => \'NAME\',\r\n                               :font_size          => SIZE,\r\n                               :left               => \'TEXT\',\r\n                               :right              => \'TEXT\',\r\n                               :spacing            => REAL,\r\n                               :line               => true,\r\n                               :content            => \'HTML CONTENT ALREADY RENDERED\'}, # optionally you can pass plain html already rendered (useful if using pdf_from_string)\r\n                   :footer => {:html => { :template => \'shared/footer.pdf.erb\', # use :template OR :url\r\n                                          :layout   => \'pdf_plain.html\',        # optional, use \'pdf_plain.html\' for a pdf_plain.html.erb file, defaults to main layout\r\n                                          :url      => \'www.example.com\',\r\n                                          :locals   => { :foo => @bar }},\r\n                               :center             => \'TEXT\',\r\n                               :font_name          => \'NAME\',\r\n                               :font_size          => SIZE,\r\n                               :left               => \'TEXT\',\r\n                               :right              => \'TEXT\',\r\n                               :spacing            => REAL,\r\n                               :line               => true,\r\n                               :content            => \'HTML CONTENT ALREADY RENDERED\'}, # optionally you can pass plain html already rendered (useful if using pdf_from_string)\r\n                   :toc    => {:font_name          => \"NAME\",\r\n                               :depth              => LEVEL,\r\n                               :header_text        => \"TEXT\",\r\n                               :header_fs          => SIZE,\r\n                               :l1_font_size       => SIZE,\r\n                               :l2_font_size       => SIZE,\r\n                               :l3_font_size       => SIZE,\r\n                               :l4_font_size       => SIZE,\r\n                               :l5_font_size       => SIZE,\r\n                               :l6_font_size       => SIZE,\r\n                               :l7_font_size       => SIZE,\r\n                               :l1_indentation     => NUM,\r\n                               :l2_indentation     => NUM,\r\n                               :l3_indentation     => NUM,\r\n                               :l4_indentation     => NUM,\r\n                               :l5_indentation     => NUM,\r\n                               :l6_indentation     => NUM,\r\n                               :l7_indentation     => NUM,\r\n                               :no_dots            => true,\r\n                               :disable_links      => true,\r\n                               :disable_back_links => true},\r\n                   :outline => {:outline           => true,\r\n                                :outline_depth     => LEVEL}\r\n          end\r\n        end\r\n      end\r\n    end\r\n\r\nBy default, it will render without a layout (:layout => false) and the template for the current controller and action.\r\n\r\n### Super Advanced Usage ###\r\n\r\nIf you need to just create a pdf and not display it:\r\n\r\n    # create a pdf from a string\r\n    pdf = WickedPdf.new.pdf_from_string(\'<h1>Hello There!</h1>\')\r\n\r\n    # create a pdf from string using templates, layouts and content option for header or footer\r\n    WickedPdf.new.pdf_from_string(\r\n        render_to_string(:pdf => \"pdf_file.pdf\", :template => \'templates/pdf.html.erb\', :layout => \'pdfs/layout_pdf\'), \r\n        :footer => {:content => render_to_string({:template => \'templates/pdf_footer.html.erb\', :layout => \'pdfs/layout_pdf\'})}\r\n        )	\r\n    # or from your controller, using views & templates and all wicked_pdf options as normal\r\n    pdf = render_to_string :pdf => \"some_file_name\"\r\n		\r\n    # then save to a file\r\n    save_path = Rails.root.join(\'pdfs\',\'filename.pdf\')\r\n    File.open(save_path, \'wb\') do |file|\r\n      file << pdf\r\n    end\r\n\r\nIf you need to display utf encoded characters, add this to your pdf views or layouts:\r\n\r\n    <meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />\r\n\r\n### Styles\r\n\r\nYou must define absolute paths to CSS files, images, and javascripts; the best option is to use the *wicked_pdf_stylesheet_link_tag*, *wicked_pdf_image_tag*, and *wicked_pdf_javascript_include_tag* helpers.\r\n\r\n    <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n       \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n    <html xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"en\" lang=\"en\">\r\n      <head>\r\n        <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\r\n        <%= wicked_pdf_stylesheet_link_tag \"pdf\" -%>\r\n        <%= wicked_pdf_javascript_include_tag \"number_pages\" %>\r\n      </head>\r\n      <body onload=\'number_pages\'>\r\n        <div id=\"header\">\r\n          <%= wicked_pdf_image_tag \'mysite.jpg\' %>\r\n        </div>\r\n        <div id=\"content\">\r\n          <%= yield %>\r\n        </div>\r\n      </body>\r\n    </html>\r\n\r\n### Page Numbering\r\n\r\nA bit of javascript can help you number your pages. Create a template or header/footer file with this:\r\n\r\n    <html>\r\n      <head>\r\n        <script>\r\n          function number_pages() {\r\n            var vars={};\r\n            var x=document.location.search.substring(1).split(\'&\');\r\n            for(var i in x) {var z=x[i].split(\'=\',2);vars[z[0]] = unescape(z[1]);}\r\n            var x=[\'frompage\',\'topage\',\'page\',\'webpage\',\'section\',\'subsection\',\'subsubsection\'];\r\n            for(var i in x) {\r\n              var y = document.getElementsByClassName(x[i]);\r\n              for(var j=0; j<y.length; ++j) y[j].textContent = vars[x[i]];\r\n            }\r\n          }\r\n        </script>\r\n      </head>\r\n      <body onload=\"number_pages()\">\r\n        Page <span class=\"page\"></span> of <span class=\"topage\"></span>\r\n      </body>\r\n    </html>\r\n\r\nAnything with a class listed in \"var x\" above will be auto-filled at render time.\r\n\r\nIf you do not have explicit page breaks (and therefore do not have any \"page\" class), you can also use wkhtmltopdf\'s built in page number generation by setting one of the headers to \"[page]\":\r\n\r\n    render :pdf => \'filename\', :header => { :right => \'[page] of [topage]\' }\r\n\r\n### Configuration\r\n\r\nYou can put your default configuration, applied to all pdf\'s at \"wicked_pdf.rb\" initializer.\r\n\r\n### Rack Middleware\r\n\r\nIf you would like to have WickedPdf automatically generate PDF views for all (or nearly all) pages by appending .pdf to the URL, add the following to your Rails app:\r\n\r\n    # in application.rb (Rails3) or environment.rb (Rails2)\r\n    require \'wicked_pdf\'\r\n    config.middleware.use WickedPdf::Middleware\r\n\r\nIf you want to turn on or off the middleware for certain urls, use the `:only` or `:except` conditions like so:\r\n\r\n    # conditions can be plain strings or regular expressions, and you can supply only one or an array\r\n    config.middleware.use WickedPdf::Middleware, {}, :only => \'/invoice\'\r\n    config.middleware.use WickedPdf::Middleware, {}, :except => [ %r[^/admin], \'/secret\', %r[^/people/\\d] ]\r\n\r\nIf you use the standard `render :pdf => \'some_pdf\'` in your app, you will want to exclude those actions from the middleware.\r\n\r\n### Further Reading\r\n\r\nAndreas Happe\'s post [Generating PDFs from Ruby on Rails](http://www.snikt.net/blog/2012/04/26/wicked-pdf/)\r\n\r\nStackOverflow [questions with the tag \"wicked-pdf\"](http://stackoverflow.com/questions/tagged/wicked-pdf)\r\n\r\n### Debugging\r\n\r\nNow you can use a debug param on the URL that shows you the content of the pdf in plain html to design it faster.\r\n\r\nFirst of all you must configure the render parameter \":show_as_html => params[:debug]\" and then just use it like normally but adding \"debug=1\" as a param:\r\n\r\nhttp://localhost:3001/CONTROLLER/X.pdf?debug=1\r\n\r\nHowever, the wicked_pdf_* helpers will use file:/// paths for assets when using :show_as_html, and your browser\'s cross-domain safety feature will kick in, and not render them. To get around this, you can load your assets like so in your templates:\r\n\r\n    <%= params[:debug].present? ? image_tag(\'foo\') : wicked_pdf_image_tag(\'foo\') %>\r\n\r\n### Inspiration\r\n\r\nYou may have noticed: this plugin is heavily inspired by the PrinceXML plugin [princely](http://github.com/mbleigh/princely/tree/master).  PrinceXML\'s cost was prohibitive for me. So, with a little help from some friends (thanks [jqr](http://github.com/jqr)), I tracked down wkhtmltopdf, and here we are.\r\n\r\n### Awesome Peoples\r\n\r\nAlso, thanks to [unixmonkey](https://github.com/Unixmonkey), [galdomedia](http://github.com/galdomedia), [jcrisp](http://github.com/jcrisp), [lleirborras](http://github.com/lleirborras), [tiennou](http://github.com/tiennou), and everyone else for all their hard work and patience with my delays in merging in their enhancements.\r\n',0,'2013-03-14 14:11:56','2013-03-14 14:12:23'),(3,'Creating and editing a school','### School Admin Help\r\n\r\n_From this page you can edit your school information as well as control how your schools display page looks._\r\n\r\n**Name**\r\nChoose a descriptive but not too long name for your school\r\n\r\n**Tag Line**\r\nThis short line is a sort of welcome to the school statement. Use it to say something short and pithy about your school. A school slogan or theme often works well here.\r\n\r\n**Location**\r\nThis is short friendly description of your schools location.\r\n _Not a mailing address - there is a separate field for that._\r\n\r\n',0,'2013-03-30 22:13:00','2013-05-12 14:20:53'),(4,'Setting Due Dates and Times','### Assignment Due Times and Dates\r\n\r\n___Due Times and Dates can be set on a per Core Team basis.___\r\n\r\nThus you can have full control over when a group of students work is due.\r\n\r\nAssignments are broken into modules for easier organization and to prevent uncomfortably long lists of assignments to work with.\r\n\r\nOnce the due time is past students can no longer edit their assignments until after the assignment has been returned by their assigned staff.',0,'2013-05-12 14:37:27','2013-05-12 19:11:48'),(5,'Templates - Creation and Editing','### Working with Templates\r\n\r\n>\r\n_Templates can be used in any document type assignment task. These templates are loaded the first time an task is opened and form the basis of any document task._\r\n\r\n___Tips for creating a good template___\r\n\r\n* Use headings as much as possible to divide sections of your documents.\r\n	* Remember there are 6 levels of heading so you actually have a lot of options.\r\n	* Bold and Bold_Italic are also good choices for section breaks.\r\n* Keep your template simple and try to make it obvious where the student should add their content.',0,'2013-05-12 18:44:38','2013-05-12 19:11:19'),(6,'Scoresheets - grading report templates','### Creating and Editing Scoresheets\r\n\r\n___Scoresheets are the templates used to form the basis of the grading reports.___ \r\n_(sometimes called coversheets)_\r\n\r\nScoresheets function the same way grading reports that templates do for document tasks. They are loaded the first time you open the _\"finish grading\"_ page. The purpose of these templates is to help your staff create consistent and helpful reports to the student after they are finished grading an assignment. \r\n\r\n___Tips for creating good coversheets___\r\n\r\n* You can make as many coversheets as you like so feel free to make special ones to match specific assignments. This can help your staff to grade and report back to your students much consistently.\r\n* Think through important aspects of your staff\'s feedback and design the coversheet template to assist your staff with giving useful feedback.\r\n	* Leave a place for encouragement for example, to remind your staff to give positive feedback as well as correction.\r\n\r\n\r\n\r\n',0,'2013-05-12 19:15:03','2013-05-12 19:27:03'),(8,'Creating Observations for selection','### Creating Inductive observation choices\r\n\r\n>\r\n_Observations from this list are the ones available to your students as they work on their inductive charts. You can create as many or as few as you would like to help your students remember what kinds of things they are looking for. The abbreviations(Code) as there to save space and to provide consistency, making grading much easier over time._\r\n\r\n___Tips for creating good observations___\r\n\r\n\r\n* Try to make your abbreviations(Code) consistent and intuitive.\r\n	* BUT SHORT!\r\n	* Example: Contrast [><] or Who [W] or event [E]\r\n* Try to create them in an order that makes sense, putting the most common observations near the top of the list.\r\n\r\n\r\n\r\n',0,'2013-05-12 19:31:52','2013-05-12 19:56:33'),(9,'Tips for creating Titles','### Paragraph Titles\r\n\r\n',0,'2013-05-18 17:17:40','2013-05-18 17:18:16');
