INSERT INTO `papers` VALUES (4,1,'First big paper','Tom Possin','Big ','This is a really big paper.','**This is ok I wish there was a bit of padding though.**\r\n\r\n* This works now.\r\n	* So does this.\r\n	* Yep\r\n\r\nbye bye\r\n\r\n\r\n',1,1,'2013-04-30 00:38:18','2013-05-15 20:34:13'),(5,1,'Second Big Paper','Tom Possin','Second','This is my second big paper on this site.','## Well Well\r\n\r\nI guess this is a writing device of some kind now. The autosave is working and so is the previewer.\r\n\r\nNow I just have to get all the communication and reviewer stuff working.\r\n\r\nAnd of course a decent forward facing page.\r\n\r\n',0,0,'2013-04-30 01:04:55','2013-04-30 03:26:08'),(8,1,'Third Big Paper','Tom Possin','Third paper','This is another big paper.','## Sweet Sweet Paper\r\n\r\nOh I love me some papers.\r\n\r\n',0,0,'2013-04-30 21:16:10','2013-04-30 21:17:12');
